import React from "react";
import "./Footer.css";

const Footer = () => {
  return (
    <footer>
      <p>&copy; Adam Stewart. <a href="#">Support</a> | <a href="#">Privacy Policy</a></p>
    </footer>
  );
};

export default Footer;
